"use strict";const INT32_MAX=4294967295;function sleep(e){return new Promise((t=>setTimeout(t,e)))}function isEmpty(e){return!e||0===e.length}function staticUrl(){return window.location.protocol+"//"+window.location.host}function apiUrl(){return staticUrl()+"/api"}function escapeHtml(e){return e.replace(/&/g,"&amp;").replace(/</g,"&lt;").replace(/>/g,"&gt;").replace(/"/g,"&quot;").replace(/'/g,"&#039;")}function readableTimestamp(e){let t=Date.now()-e;return t<0?moment(e).format("h:mma M/D/YY"):t<3e4?"a few seconds ago":t<6e4?"less than a minute ago":t<9e5?`${Math.round(t/6e4)} minutes ago`:moment(e).format("h:mma M/D/YY")}function standardizeString(e){return e.trim().replace(/[^\w\s]/gi,"").toUpperCase()}function sleep(e){return new Promise((t=>setTimeout(t,e)))}function ordinal_suffix_of(e){var t=e%10,n=e%100;return 1==t&&11!=n?e+"st":2==t&&12!=n?e+"nd":3==t&&13!=n?e+"rd":e+"th"}var alertCounter=0;function giveAlert(e,t,n){var r="alert"+alertCounter;document.getElementById("alert-zone").innerHTML+=`<div id="${r}" class="alert alert-dismissable ${t}" role="alert">\n        ${e}\n        <button type="button" class="close" data-dismiss="alert" aria-label="Close">\n          <span aria-hidden="true">&times;</span>\n        </button>\n    </div>`,n||$("#"+r).fadeTo(3e3,500).slideUp(500,(function(){$("#"+r).slideUp(500),this.parentNode.removeChild(this)})),alertCounter++}function givePermError(e){giveAlert(e,"alert-danger",!0)}function giveTempError(e){giveAlert(e,"alert-danger",!1)}function giveTempSuccess(e){giveAlert(e,"alert-success",!1)}function givePermSuccess(e){giveAlert(e,"alert-success",!0)}function giveTempInfo(e){giveAlert(e,"alert-info",!1)}function linkAbsolute(e,t){return'<a style="display: inline-block;" href="'+t+'">'+e+"</a>"}function linkRelative(e,t){return linkAbsolute(e,staticUrl()+t)}async function fetchJson(e,t={}){let n=await fetch(e,t);if(!n.ok)throw Error(await n.text());return n.json()}